import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default function App() {
  return (
    <Router>
      <Switch>
        <Route exact path = "/">
          <Home />
        </Route>
        <Route path = "/home">
          <Home />
        </Route>
        <Route path="*">
          <InvalidPath />
        </Route>
      </Switch>
    </Router>
  )
}

function Home() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          This website is my (Seb Kryspin) web development playground.
          Say 'hi' in the following places:
        </p>
        <a
          className="App-link"
          href="https://www.linkedin.com/in/skryspin/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Seb Kryspin on LinkedIn
        </a>
      </header>
    </div>
  );
}

function InvalidPath() {
  return (
    <p>This page doesn't exist. You can either stay here forever, or <Link to="/"> return to civilization.</Link> </p>
  );
}
